(72, 'Rajesh Asempelly', 'I know the FW for the last 4 years and observed him to be sincere and committed to the Lord. He accompanied me on several occasions for ministry visits. I taught him the Meridian course. He is quite knowledgeable in the Word. He has a potential to plant churches as he has burden to reach out to the unreached villages.', 84),
