(86, 'Bhaskar Swain Administrator', 'I have good relationship with the field worker for last 15 months. I used to meet him once in a month to know about their spiritual and ministerial progress. He is bearing a good moral and biblical character. He has the potential of planting Church as he has done good work during the field outreach to share gospel. Theologically he is good and will also learn things while we will work together. He has good learning attitude. As he has also the burden to plant churches among unreached areas, 500k also has the same vision. Therefore he is fit for 500k.   ', 103),
(87, 'Bhaskar Swain Administrator', 'I have good relation with him and almost every month we meet with each other to some time to know about the ministry. He has good Christian Character, and has the potential to plant church as he is active in outreach/sharing gospel. During the one year of training, he has learnt many things still he is learning. He is good as of now. He has the passion for the Church planting that\'s why he is fit for 500k FW sponsorship.   ', 104),
(89, 'Bhaskar Swain Administrator', 'I have good relationship with the FW and spending time on monthly basis while I visiting Bible school to know the progress. He has good Christian character and having good potential of planting Church as he is good and hardworking in the field. He can plant a Church under the proper guidance. He is good in theology and during the bible school training time have learnt the word of God. As he is working hard and sincere in the ministry therefore he is good fit for 500k program.  ', 106),
(91, 'Bhaskar Swain Administrator', 'I have good relationship with the field worker as I used to meet him once in a month to know about their progress. He is bearing a good moral and biblical character. He has the potential of planting Church as he has done good work during the field outreach to share gospel. Theologically he is good and will also learn things while we will work together. He has good learning attitude. As he has also the burden to plant churches among unreached areas. Therefore he is fit for 500k.   ', 108),
(92, 'Bhaskar Swain Administrator', 'I have good relationship with the field worker for last 15 months. I used to meet him once in a month to know about their spiritual and ministerial progress. He is good and sincere boy bearing biblical character and growing in them day to day life. He has the potential of planting Church as he has done very good work during the field outreach in his village. He has won few souls over there by sharing gospel. Theologically he is good and will also learn things while we will work together. He is good in learning and zeal for the souls. Therefore he is good for 500k.', 109),
(93, 'Bhaskar Swain Administrator', 'I have good relationship with the field worker for last 15 months. I have been regular in touch with him for last one year during his stay in Bible School.  He is good in moral and biblical character. He is sincerely following the word of God in his personal life. He has the good potential of planting Church as he has already won few souls in his village during the outreach by sharing gospel. Theologically he is good and will also learn things while we will work together. He has good learning attitude. As he has also the burden to plant churches among unreached areas, 500k also has the same vision. Therefore he is fit for 500k.', 110),
(95, 'Bhaskar Swain Administrator', 'During his tenure in the Bible School he has been very good in discipline, learning and adopting Godly character in his day to day life. We used to spent time together once in a month for last more than 1 year of time. He has the great potential of planting Church as he has done good work during the field outreach with the team leader to share gospel and prayer walk. Theologically he is good and still many things need to learn in the days to come while we will work together. As he has also the burden to plant churches among unreached areas, 500k also has the same vision. Therefore he is fit for 500k.   ', 112),
(96, 'Bhaskar Swain Administrator', 'I have good relationship with the field worker for last 15 months. I used to meet him once in a month to know about their growth. He is bearing a good moral and biblical character. He has the potential of planting Church as he has done good work during the field outreach to share gospel. Theologically he is good and will also learn things while we will work together. He has good learning attitude. As he has also the burden to plant churches among unreached areas, 500k also has the same vision. Therefore he is fit for 500k.   ', 113),
(99, 'Bhaskar Swain Administrator', 'She has learnt the word of God for more than last one year. I got opportunity to meet each students once in a month and develop a good relationship. She is good in faith and obedient. Bearing good moral and Christian Character. During the outreach for one month she has been regular in the evangelism activities and having zeal to save souls. She is good in theology and still learning and always actively learnt in the class. As she is dedicated for ministry and hard working therefore she is good fit for 500k.', 116),
(101, 'Bhaskar Swain Administrator', 'I have good relationship with the field worker for last 15 months. I used to meet her once in a month to know about their spiritual and ministerial progress. She is bearing a good moral and biblical character. She has the potential of planting Church as she has done good work during the field outreach to share gospel. Theologically she is good and will also learn things while we will work together. She has good learning attitude. As she has also the burden to plant churches among unreached areas, 500k also has the same vision. Therefore he is fit for 500k.   ', 118),
(102, 'Bhaskar Swain Administrator', 'I used to meet all the students once in a month to know about their spiritual and ministerial progress. I have good relationship with her too and she has been very good in discipline her life according to the word of God. She is bearing a good moral and biblical character. She has been active in the evangelism and saving souls which shows her potential of planting Church. Theologically also she is good and will  learn many things in days to come. She has also the burden to plant churches among unreached areas, and funding by 500k will help her. She will be good fit for 500k. ', 119),
(103, 'Bhaskar Swain Administrator', 'I used to spent time once in a month with the students in the Bible School and she has good character. She is good in evangelism and she can easily plant a Church by God\'s grace. She is good in theology and having learning attitude too. She will be an asset for 500k program. ', 120),
(104, 'Bhaskar Swain Administrator', 'She has been good in brining her life according to the word of God. She has been good and sincere during the her training time. She has the potential of planting Church as she is actively sharing her faith to the non believers regularly. She is good in theology and still learning. She has the vision and burden for Church planting and will be good fit for 500k.', 121),
(105, 'Bhaskar Swain Administrator', 'He is very good and God fearing guy, dedicated for ministry. I have personally known him for last 20 years. He has good moral character and leading a submissive life. He has good potential of planting Church and serving Lord. He have been active in the ministry activities and he will do the ministry work sincerely. He is good in theology and having learning attitude to grape the new spiritual things in his life. He will be good for 500k as he has the vision and dedication for the unreached peoples to save them. ', 122),
(106, 'Bishop Dhanraj Kota', 'yes', 123),
(107, 'Akkem Yedukondalu', '1. Well known since 5 years met in gospel ministry.\r\n2. Handworker, Ministry minded,  Faithful in spreading Gospel.\r\n3. He is committed to do full time ministry even in the bad times he has that dedication in ministry.\r\n4. Well versed with Theology the way he preached and delivered the messages.\r\n5. He worked along with our supervisor when ever they were given any ministry work they used to share the pulpit as well as the street preaching\'s.', 124),
(108, 'Bhaskar Swain Administrator', 'I have been meeting him once in a month during my visit to the Bible School and found to be hard working and faithful. He is good and sincere about the ministry. He is dedicated and having the  burden for the souls. He is good in word also and will be very good for the 500k program as FW and 500k program have the same vision.', 125),
(111, 'Bhaskar Swain Administrator', 'I have good relationship with the field worker for last 15 months. I used to meet him once in a month to know about him during my visit to the Bible school. He is bearing a good moral and biblical character. He has the potential of planting Church as he has done good work during the field outreach to share gospel. Theologically he is good and will also learn things while we will work together. He has good learning attitude. As he has also the burden to plant churches among unreached areas, 500k also has the same vision. Therefore he is fit for 500k.   ', 128),
(113, 'Bhaskar Swain Administrator', 'He have been found good and sincere since he is in Bible school. We have spent good time during my visit to the Bible School. He is hard working and bearing good moral and Christian character. He is good in sharing gospel and hunger to save souls. He has been sharing gospel to the new peoples during the outreach. He is good in the learning of word of God. He is dedicated for Church planting ministry and fit for 500k program.', 130),
(115, 'Bhaskar Swain Administrator', 'I have been knew him from his childhood. He has been very good in taking up responsibility and bearing good moral and Christian characteristics. He has very good potential of planting Churches as he has been always working hard in the field. He is good in theology as he has been learning and meditating the word of God. He will be very good fit for 500k as he is dedicated for the Church ministry.', 132),
(116, 'Bhaskar Swain Administrator', 'I have very good relation with him as he is good and active believer of our Church. He has been hard working and having burden for the ministry therefore we have trained him in the Bible School. He is good and bearing moral and Christian character. He is dedicated and committed his life for Church ministry. He also good in theology and he has been taught in the Church as well as in the Bible School. He is good for 500k program as he wants to save souls and plant churches. ', 133),
