(119, 'Bhaskar Swain Administrator', 'Kamal Dev is a bible School Student for last year. He has been good and dedicated for the Church ministry. During my monthly visit to the Bible School, I found him sincere and having learning attitude. He is faithful and hardworking man. He has good in moral and spiritual biblical character. He has proved during the outreach that he has good potential of planting a Church. He has done good work in outreach. Theologically also he is good and he will be good for 500k program as he is dedicated for the Church planting at new places. ', 136),
(120, 'Bhaskar Swain Administrator', 'I have good relationship with him and found him good and sincere in the study. I have been meeting him once in a month while my visit to the Bible School. He is good and faithful in the ministry. He has good potential of planting church as he has shared gospel in the field very actively. He is good in theology as he learned the word of God in the Bible School. He will be very good fit for for 500k sponsorship program ', 137),
(121, 'Bhaskar Swain Administrator', 'I have good relationship with him and found him good and sincere in the study. I have been meeting him once in a month while my visit to the Bible School. He is good and faithful in the ministry. He has good potential of planting church as he has shared gospel in the field very actively. He is good in theology as he learned the word of God in the Bible School. He will be very good fit for for 500k sponsorship program', 138),
(122, 'Bhaskar Swain Administrator', 'I have good relationship with her and found her good and sincere in learning the word of God. I have been meeting him once in a month while my visit to the Bible School. He is good and faithful in the ministry. She is bearing good Christian and moral character. She has good potential of planting church as she has shared gospel in the field very actively. She is good in theology as he learned the word of God in the Bible School. She will be very good fit for for 500k sponsorship program', 139),
(123, ' Dhanraj Kota', 'He is a born again Christian. I know him since 10 years. His character is good. He has the passion for the perishing souls. He has the zeal to serve the Lord and has good testimony in the society.\r\nHe has the potential to plant church in spite of hardships.  \r\nHe is doctrinally sound  and has strong theological background. He underwent training for 3 years Diploma in Biblical Studies from Maranatha Bible College. He completed Discipleship Training programme (DTP) from Youth with a mission (YWAM) . He is very faithful and sincere to serve his target group. As he is associated with us since 10 years, we have noticed his enthusiasm and zeal. So I strongly recommend him for the sponsorship program. \r\n', 141),
(124, 'Bhaskar Swain Administrator', 'I have been in touch with her for last 15 months and found she has been very sincere in her all attitude and and learning. Every month while my visiting to the Bible School, I have seen her growing and bearing good moral and Christian character. She has good in the field to share gospel and dedicated for Church planting ministry. She has learned the theological education for last 15 months and learned in well manner. She will be good fit for the 500k sponsorship as she has the heart for the people dying in sin without knowing Jesus Christ. ', 143),
(125, 'Bhaskar Swain Administrator', 'I have known her for last more than 2 years. Since Suman Pakhrin have associated with us and started ministry, we used to meet her and found she is very faithful and hardworking woman. She is having good heart for ministry and having good knowledge of the word of God. Yes, as she has the burden for the dying souls, she will be an asset for the 500k. ', 145),
(127, 'Bhaskar Swain Administrator', 'Sarita, I have been knowing her for last about two years. Sarita and her husband Pramod are very dedicated towards the ministry and sincerely working for the kingdom of God. In the early days of their believing Christ, as they were so active in the faith and fellowship, we took them under the TTI program and started to teach them about Church planting. They are bearing very good character moral character of Christ. They are dedicated and sincere in the ministry and having learning attitude. They are learning and doing good accordingly. There is no doubt they will be very much effective in the field if 500k sponsorship covered them. While they are working without any financial support, if the financial support is available for them, they can work more and spent much time in the ministry.   ', 147),
(128, 'Gurram Sekhar, Founder & Director Bethany Bible Institute', '1. Studied in our institute observed his dedication up on the ministry and also the willingness to learn and serve God in his region.\r\n2. Very good \r\n3. Did watched him going to ministry daily without stopping and encouraging people to come to the knowledge of the Lord to be saved from eternal Hell.\r\n4. Observed HIs dependence, He Believes Bible is the only mirror where a man\'s character can be revealed and also believes that Jesus Christ is The Son of God and Through Him the salvation came to mankind.\r\n5. The willingness to go anywhere any time to preach and teach the word of God to the perishing souls. His dedication upon the job and faithful towards the given work.', 149),
(129, 'Gurram Sekhar, Founder & Director Bethany Bible Institute', '1. Active Student in our Institute we have spent 2 years \r\n2. Very Satisfactory \r\n3. He has chosen 3 villages and mulampeta is the primary village selected by him. As soon as we announced about the vision of our ministry He came up with this ideology, which made me to think and offer him this work.\r\n4. After His biblical training session he gave a testimony saying many things were learnt by him and God has enlightened him with good biblical knowledge.\r\n5. His ideology and dedication towards the given work and willingness to work among the poor people.', 150),
(130, 'Gurram Sekhar, Founder & Director Bethany Bible Institute', '1. Known personally since 20 years worked in some projects \r\n2. Very Dedicated towards work and ministry oriented.\r\n3. He can plant 3 churches in different villages because his dedication I have seen personally.\r\n4. Learned the Hermeneutics perfect way of preaching gospel. The gospel which we shared till now was not so effective but after getting ourselves equipped with good theology and training we have changed our way of teaching and preaching.\r\n5. There are very few who have the burden to preach and train the tribal\'s he came up with heavy burden towards the tribal people and was looking for someone who can support him and he found us.  ', 151),
