(146, 'Akkem Yedukondalu', 'Fw is a born again Christian. \r\nshe has potential to plant church in spite hardships. \r\nshe has zeal to serve the Lord and has good testimony.\r\nshe is doctrinally sound has strong theological background. \r\nshe is Faithful to serve his target group.\r\n', 172),
(147, 'Ramavath. Ramsingh Naik', '1. I Know him personally since 8 years\r\n2. I believe him in his ministry work\r\n3. He has good testimony\r\n4. He is done his theologically trained at Bethany bible institute\r\n5. He is faithful to serve', 174),
(148, 'Butti. Dileepkumar', '1.I know him personally since 15 years\r\n2. I believe him in his ministry work\r\n3. He has good testimony\r\n4. He done his theologically trained at bethany bible institute \r\n5. He is faithful to serve ', 175),
(149, 'M.S. Vijay kumar ', '1. I know him personally since 2 years because we studied together in bible college\r\n2. He is fore most in the service of God \r\n3. He has good testimony\r\n4. He is done his theologically trained at Bethany Bible Institute\r\n5. He is faithful to serve.', 178),
(150, 'Popavath. Rama murthy naik', '1. I know him personally since 1 year because we studied together in bible college\r\n2. He is fore most in the service of God \r\n3. He has good testimony\r\n4. He is done his theologically trained at Bethany Bible Institute\r\n5. He is faithful to serve.                            \r\n', 180),
(154, 'Selvakumar      Staff', 'I know him well for last 6 years. He is a faithful committed person and good in character and he is also a talented person.\r\nHe has good biblical knowledge. He has a vision for lost souls.', 191),
(155, 'Thaveethu Thevanithi', 'I know him well for about 6 years.\r\nHe is a good person and committed man. He is interested in the full time ministry and he was praying and expecting for the opportunity.\r\nHe has a good  teaching skill.\r\nHe is a knowledgeable and efficient man. He is the right person ', 193),
(157, 'James Thangaraj      Staff', 'I know him well for about last five years.\r\nHe is a faithful and committed brother in Christ who has a zeal to do ministry effectively.\r\nHe is a a talented and capable person.\r\nHe is fit for this sponsorship program.', 195),
(158, 'Thaveethu Thevanithi', 'I know him well from 2015 onwards as he studied here.\r\nHe is good,simple and faithful and committed man.\r\nHe is talented in sharing the gospel in an nice manner.\r\nHe has a vision and burden for the lost souls.', 196),
(159, 'John Raj     Staff', 'I know him well for last four years.\r\nHe is so simple and humble man. He has a burden towards lost souls and he would like to expand his ministry to many areas.\r\nHe is good in character. He is a courageous man. Even though he is facing a lot of opposition he is doing the ministry boldly. He has ability to share gospel to rural areas.', 197),
(161, 'Thaveethu Thevanithi', 'I know him for last three years. He is good and simple man with faith and commitment and has an interest to do His ministry.\r\nHe is an knowledgeable person and he is fit for our supporting program.', 199),
(162, 'James Thangaraj      Staff', 'I know him for many years .\r\nHe is a faithful and committed person. He has a burden to do the Lord`s ministry.\r\nHe is sharing the gospel to the people whenever he gets opportunuties to meet them.\r\nHe is a fit person to receive support so that he will concentrate on full time ministry.\r\n', 200),
(163, 'Selvakumar      Staff', 'I know him from 2015 onwards. He is a good faithful and knowledgeable brother. He has a zeal to do ministry. If he will concentrate on full time ministry he will do the ministry effectively. He has ability and enthusiasm to share the gospel to the people in a simple way. \r\n', 201),
(166, 'Timothy Jebakumar Staff', 'I know him well for last four years. He was helping a Pastor in His ministry for some years and after that he got a vision to start the ministry of his own and has moved to this place and doing ministry. \r\nHe is a so good and faithful man of God. He has come from very religious family background. He has overcome so many challenges.\r\nHe and his wife both are so kind and they show the love of God to the people where they live and minister.\r\nThey are economically struggling as they have three daughters and as they have to face education expenses also.\r\nHe is fit for the sponsorship program. ', 205),
(168, 'Selvakumar      Staff', 'I know him for many years. He is good in Character. He is a fiaithful and committed person.\r\nHe is in need of financial support. If he will get regular support he will concentrate on full time ministry.', 207),
(169, 'Selvakumar      Staff', 'I know him for many years. He is good in Character. He is a fiaithful and committed person.\r\nHe is in need of financial support. If he will get regular support he will concentrate on full time ministry.', 207),
(175, 'Daniel Jayakumar    Staff', 'I know her for many years. She is a faithful and committed sister. She is ministry minded. She will do children ministry and women ministry well. Even though she has lost her husband before some months she did not loose her interest to do the Lord`s ministry.\r\nSupport will be so useful to her family and ministry.', 213),
(177, 'Selvakumar      Staff', 'I know him for many years. He is good faithful man. He has ministry zeal.\r\nSupport will be so useful in his ministry.', 215),
(181, 'B. Solomon', '1. Well known since 20 years met in gospel ministry.\r\n2. Hardworker, Ministry minded,  Faithful in spreading Gospel.\r\n3. He is committed to do full time ministry even in the bad times he has that dedication in preaching.\r\n4. Well versed with Theology the way he preached and delivered the messages.\r\n5. He worked along with our supervisor when ever they were given any ministry work they used to share the pulpit as well as the street preaching\'s.\r\n', 221),
(183, 'Rohit (Chairman, THE HOPE SOCIETY)', 'In 2016 Amandeep Joined North India Institute of Theological Studies, he used to visit our Church for Sunday worship. \r\nHe is a very much polite person, show respect and mind his manners.\r\nHe is very much enthusiastic for planting church on new places. Noticed, his eagerness to share the love of Christ with others. \r\nHe has done Bachelors of Theology from a North India Institute of Theological Studies which is well reputed institute in North India (affiliated to ATA), and personally I have found that he is following the sound doctrine. \r\n500k sponsorship will give wings to his vision for reaching out to many villages around him. ', 231),
(186, 'Salim field manager ', '1)	Your Relationship with the FW and the time spent you have spent with him\r\n4-5 months 	\r\n2)	Your Opinion on the character of the FW\r\nHe is genuine and calm by nature.  \r\n3)	What is his church planting potential and why you think this\r\nHe wants to dedicate himself for God\'s work and has burden for unsaved people.  \r\n4)	How strong is his theological competency and why\r\nIn most of our previous conversation I found him theologically sound and do not talk out of context.  \r\n5)	Why he is a good fit for the 500k FW sponsorship program.\r\nHe has burden for unsaved souls and wants to reach out to many but due to financial problem, he is not able to go for full time ministry. But if he gets financial support from 500K then he can work more effectively and reach out to many unreached people.\r\n', 234),
(187, 'Sushma (Office Manager)', '1)	Your Relationship with the FW and the time spent you have spent with him\r\nFew months. 	\r\n2)	Your Opinion on the character of the FW\r\nHe is simple and calm, genuine and hardworking person.\r\n3)	What is his church planting potential and why you think this\r\nHe is hardworking, enthusiastic and has passion for soul winning. \r\n4)	How strong is his theological competency and why\r\nHe is theologically sound, has much knowledge of God\'s word, eager to learn more  and do not go out of context in Bible studies. \r\n5)	Why he is a good fit for the 500k FW sponsorship program.\r\nHe has much zeal for the extension of God’s kingdom, has burden for lost soul and want to do more in his surroundings but due to financial problem, he has some limitations  But with the financial support from 500K then he can work more effectively and reach out to many unreached people in surrounding areas and also help many people. \r\n', 235),
(188, 'Saleem Masih (Field Manager, THE HOPE SOCEITY) ', 'Saleem Masih knows him from his childhood. \r\n\r\nHe is a very much well-mannered person, able to handle things easily.\r\n\r\nHe is a passionate for establishing church on new places. Maintained good character in all manners. \r\n\r\nMany times we had healthy debates on different topics of the Bible, I get to know that has right knowledge of the Word of God. \r\n\r\n\r\n500k sponsorship will help him to work more effectively for the extension of God’s Kingdom. \r\n\r\n', 236),
(189, 'Selvakumar      Staff', 'He is my friend and he is good in character and he is interested in doing the Lord`s ministry.\r\nHe has ability to do the Lord`s ministry effectively. He is interested in the youth ministry. He has ability to teach and preach to unreached rural people. He is worthy person to receive support.', 237),
(190, 'Esther Mohan Daniel', 'I know for over 10 years. My husband only lead him into Christ. He is a good committed person and he will sing and pray and conduct worship service in an nice manner. He and his wife have zeal to do the Lord`s ministry. Both have good Biblical knowledge. They have experience in the children ministry and youth ministry. Actually they are waiting for the opportunity to do the full time ministry. I can assure that they will do ministry well. He is the right eligible person to receive support.', 238),
(191, 'Selvakumar      Staff', 'I know him for last three years. When he was attending a short term course I met him and we became friends.\r\nHe is a interested person. He has a good secular studies and theological studies.\r\nJust now he has started his ministry and sponsorship will be so useful to him.', 239),
(192, 'Helen     Staff', 'I know her for last 15 years as a friend. She is so faithful and committed sister and she is interested in doing the Lord`s ministry as full time. She is knowledgeable. She has experience in the children ministry and women ministry. She is a talented sister.\r\nShe is fit to the sponsorship program.', 240),
(193, 'Mrs. Kavitha Solomon       Staff', 'I know her for many years. I met her at a women`s meeting and after that we became as friends.\r\nShe is a good talented sister. She is more interested especially in the women`s ministry and children ministry.\r\nShe is a right person to receive support.', 241),
(194, 'Daniel Jayakumar    Staff', 'I know him for many years. He is a simple man with good characters.\r\nSupport will be so useful to him.', 242),
(195, 'Saleem Masih', 'I have met with Raman Kumar during a meeting in district Moga. From that day we have good relationship with each other.  He is very good man of God and I saw the potential, curiosity and hard working for the kingdom of God. He is good counselor with love to others. \r\n\r\n', 243),
(196, 'Timothy Jebakumar', 'I know him well for many years. I met at a meeting and became friends.\r\nHe is a faithful and committed person. He has a zeal to live for the Lord`s ministry.\r\nHe is the right person to receive support,.', 244),
(197, 'Selvakumar      Staff', 'I know him for many years. I went to attend a short term Bible course . At that time I met him and became friends\r\nHe is a faithful and committed man of God. He is ministry minded person. He will teach and preach to rural people in an nice manner. You can support him.', 245),
(198, 'Saleem Masih Field Manager ', 'He is the finest Person with the humble heart. He is a newly trained young guy. He knows the need of the urgency of the Gospel. He is a strong Pentecostal guy and he knows very well to share God’s love with others. Help that he will receive; It will help him to reach out the nations around his village and will also meet his personal and family needs. ', 246),
(199, 'Saleem Masih', 'He is the best Person with good education, good communication skill, computer Skill, and humble heart. He used to travel different village with the good news of Jesus Christ. He knows the need and urgency of the Gospel. He is a strong Pentecostal believer and eager to spread God’s love to others around him. Sponsorship will help him to reach out the communities around his village and will also meet his personal and family needs. ', 247),
(200, 'Saleem Masih Field Manager ', 'Prem Singh is well mannered and ministry minded person, involved in ministry from more than 5 years by helping his father in Church ministry. He has decent knowledge of the Word of God; and follows sound doctrine. He is eager to start independent ministry in Village Chack Chibranwali in district Muktsar. ', 248),
(201, 'Saleem Masih Field Manager ', 'He is a very good servant of God, always available to share Good News with others. I found that he has a good knowledge of God’s word and follows sound theology. He knows the need and urgency of the Gospel. He is a strong Pentecostal believer and eager to spread God’s love to others around him. Funding will help him to reach out the communities around his village and will also meet his personal and family needs.', 249),
(202, 'Saleem Masih Field Manager ', 'He is very good person, I know him from long time, he has good testimony among his people. He used to travel different village with the good news of Jesus Christ. He knows the need and urgency of the Gospel. He is a strong Pentecostal believer and eager to spread God’s love to others around him. Sponsorship will help him to reach out the communities around his village and will also meet his personal and family needs.', 251),
(203, 'Saleem Masih Field Manager ', 'He is a very good servant of God, always available to share Good News with others. I found that he has a good knowledge of God’s word and follows sound theology. He knows the need and urgency of the Gospel. He is a strong Pentecostal believer and eager to spread God’s love to others around him. Funding will help him to reach out the communities around his village and will also meet his personal and family needs.', 252);
INSERT INTO `missionary_five` (`id`, `ref_name`, `desc_reference`, `missionary_id`) VALUES
(204, 'Rohit Masih Chairman ', 'Saleem has a Bachelor in Theology and he is also a guy who holds on to God strongly and he is very thick skin as he working in field from long time. He is an action-oriented; very active and does all things wisely. He has a call to serve in the church over his life. He belongs to a God fearing family. He is married to Ramandeep Kaur and God has blessed them with a daughter. ', 253),
(205, 'Saleem Masih Field Manager ', 'He is a very good servant of God, always available to share Good News with others. I found that he has a good knowledge of God’s word and follows sound theology. He knows the need and urgency of the Gospel. He is a strong Pentecostal believer and eager to spread God’s love to others around him. Funding will help him to reach out the communities around his village and will also meet his personal and family needs.', 254),
(206, 'Saleem Masih Field Manager ', 'He is the finest Person with the humble heart. He is a newly trained young guy. He knows the need of the urgency of the Gospel. He is a strong Pentecostal guy and he knows very well to share God’s love with others. Help that he will receive; It will help him to reach out the different communities around his village and will also meet his personal and family needs.	', 255),
(207, 'Saleem Masih Field Manager ', 'He is a very good servant of God, always available to share Good News with others. I found that he has a good knowledge of God’s word and follows sound theology. He knows the need and urgency of the Gospel. He is a strong Pentecostal believer and eager to spread God’s love to others around him. Funding will help him to reach out the communities around his village and will also meet his personal and family needs.', 256),
(208, 'Saleem Masih Field Manager ', 'He is the finest Person with the humble heart. He is a newly trained young guy. He knows the need of the urgency of the Gospel. He is a strong Pentecostal guy and he knows very well to share God’s love with others. Help that he will receive; It will help him to reach out the nations around his village and will also meet his personal and family needs. ', 257),
(209, 'Dhanraj Kota', 'I know Ramesh for the past 5 years.  He is a faithful and hardworking Servant of God.\r\n\r\nHe has passion for perishing souls.  He is taking the gospel to the rural areas.\r\n\r\nSponsorship from 500K will help him to meet living expenses, so that he can leave the part time work and spend more time in the ministry.  \r\n', 259),
(210, 'Dhanraj Kota', 'I first met him in a Church at Siddipet when I went to minister the Word.  He was a young believer with a lot of passion and commitment to God\'s work.  \r\n\r\nI know him for the past 15 years.  He is hardworking, sincere, and humble.  He is a prayerful man.\r\n\r\nHe has strong evangelical church background, a good preacher.  He was mentored by Pastor Siddipet and worked with him for more than 5 years.\r\n\r\nHe has started church planting ministry in Maruthinagar, Jammikunta Mandal, Karimnagar.\r\n\r\n', 260),
(211, 'Kota Prasad Rao', 'Kota Prasad Rao', 261),
(212, 'Samuel John', 'I know Koteswara Rao for the past 10 years.  \r\n\r\nHe is sincere and hard working.  He has desire to serve God.  He has worked under \r\n\r\nSponsorship helps him to continue the work in Adraspally. \r\n', 262),
(213, 'Ratna Raju', 'It is my pleasure to refer Pastor Yesudas Kashapogu to 500K.  I know him for the past 10 years.  He is serving the Lord faithfully in and around Wanaparthy area.  He is a committed christian worker.  He is passionate to introduce Jesus to the people living in remote villages.  Lord has laid burden in His heart to spread His message of love.  He has been instrumental in bringing many souls to the Lord.  He has a gift of healing and gifted to cast away demons\r\n\r\nSponsorship will help him reach a new village where there is no Christian testimony. ', 263),
(214, 'Ratna Raj', 'Ratna Raj', 264),
(215, 'Kota Prasad Rao', 'Venkatiah is a very sincere servant of God.  He has passion to take the gospel to the unreached.  \r\n\r\nHe came to know the Lord from Hindu background.  God is using him with gifts of healing.\r\n\r\n500K sponsorship will help him to plant a church in a new village. ', 265),
(217, 'Sudhakar Chiluka', 'Buchaiah is hard working and sincered worker in the ministry.  He is passionate about church planting.\r\n\r\nHe wants to take the gospel to remote villages of Telangana.  His income from agriculture labour is meager.  500 K sponsorship will help him to focus on the ministry without worrying to meeting his daily expenses.\r\n\r\nI recommend him to work under 500K', 267),
(218, 'Ratna Raj', 'Ratna Raj', 268),
(219, 'Ratna Raj', 'Ratna Raj', 269),
(221, 'Pastor David Raju', 'I know Sekhar from a very young age.  He comes from a Hindu family.  He came to know the Lord in 2015.  I had the privilege of counseling him and leading him in to water Baptism.  He is eager to come and participate in the Church service.  He is a good human being.  He used to work as agriculture labor and a part-time porter while he was studying.  \r\n\r\nHe expressed his desire to serve the Lord in the ministry.  I prayed with him and dedicated him to the full-time ministry.  He has been working in Surrepally for the past 6 months.  He is passionate to share the good news of Jesus.  Lord has used him to lead one family to the believing knowledge of Jesus.  \r\n\r\nSponsorship from 500K helps him focused on the ministry without depending on part-time work.', 271),
(222, 'Ratna Raj', 'dfdfdf', 272),
(223, 'Ratna Raj', 'Ratna Raj', 273),
(225, 'Immanuel Paspula', 'Immanuel Paspula', 276),
(226, 'Kota Prasad Rao', 'I know him for the past 20 years.  He is a faithful worker for the Lord.  I had the privilege of working along with Him in Pastorial Ministry at Chandepally.  \r\n\r\nHe has worked with the Baptist Church, Tarnaka for 5 years.  \r\n\r\nGod has gifted him with a good voice.  He is a good singer.  He is a good preacher.  \r\n\r\nHe desires to take the good news of Jesus to remote parts of Telangana. \r\n\r\nSponsorship from 500K will help him to meet his family needs and dedicate more time to work for the Lord.', 277),
(227, 'Rev. Ronald John', 'I know him for the past 12 years. He is economically poor.\r\n\r\nHe works as a daily-labour to meet family needs.  He is hard-working and sincere.\r\n\r\nIn spite of lack of resources, he wants serve the Lord.  He has a desire to plant a Church where there is no Christian Testimony.  He travels on bicycle from village to village to share the good news of Jesus.  \r\n\r\nGod has gifted him with the word of wisdom, discerning spirit and gift of healing.  \r\n\r\nSponsorship will help him to continue church planting ministry at Adavi Padira Village as well as meet family expenses.', 278),
(228, 'Dhanraj Kota', 'Dhanraj Kota', 280),
(229, 'Dhanraj Kota', 'I know Bhasker for the last 15 years.  It was my privilege to lead him to the Lord in the water baptism.  \r\n\r\nHis father was a Pastor Basker is raised in a God fearing family.  He was working in a factory and also serving the Lord with his father at Bibnagar Mandal.  In 2021 July, he has committed himself to God\'s service.  It is my privilege to encourage him to work for the Lord.  \r\n\r\nLord has led him to chose Padamati Somaram village to plant a Church.  Sponsorship from 500K will help him to meet living expenses of his family so that he can focus full-time without depending on daily-wage work that he was doing earlier. ', 281),
(230, 'Rev. N.G. Samuel', 'I personally know Rubesh for the past 10 years.  He is a man of integrity and a sincere worker.  He has a desire to lead people to salvation experience.  I can certainly say that he is called for the ministry.  He seeks God\'s guidance in his endeavors. \r\n\r\nHe wants to plant a church in Madnoor.  500K Sponsorship will help him focus on church planting.\r\n\r\nI recommend him to work under 500K', 285),
(231, 'Dhanraj Kota', 'I know him for the past 15 years.\r\n\r\nHe is serving the Lord while working as a part time labor.\r\n\r\nSponsorship from 500K will help him to meet his family needs and dedicate more time to work for the Lord.', 287),
(232, 'Pastor David Raju', 'I know him for the part 5 years.  I comes from economically poor background.  \r\n\r\nHe went through harsh childhood.  His biological parents abandoned him.  Lord in His mercy, brought him to the saving knowledge of Jesus Christ.\r\n\r\nHe was mentored and trained by Pastor Paul at Nagarjuna Sagar for 2 years, which gives him a very good foundation in teaching and preaching the Word.\r\n\r\nHe has burden to help orphaned children.  He is serving the Lord among slums.  He has strong interpersonal skills.\r\n\r\nHis wife Ramana accompanies him in the ministry, both of them are committed to serve the poor and preach the Gospel.\r\n\r\n500K sponsorship will immensely help him to give more time to the ministry while it supports his family needs without depending on daily-wage work.', 288),
(233, 'Bhaskar Swain Administrator', 'Jaswant Singh is doing ministry in Kaithal, Hariyana. Personally when I met with Brother Jaswant Singh found to be sincere and having zeal for the kingdom of God. He is dedicated for the ministry and completed 3 years Bachelor in Theology to learn and serve the Lord. He has bearing a good Christian Character both in moral and spiritual. He has burden and already doing ministry without and support guidance. When we met him and seen his potential for the ministry if he can good guidance and some support. Presently about 50 people are gathering in the fellowship he is leading at Kaithal. He has good knowledge of word of God and still learning. 500k assistance will help him to work more for the kingdom what he is not able to do now due to financial lacking. We believe that this financial help will enable him for work more in the ministry and we can see more result in future days.   ', 289),
(234, 'Bhaskar Swain Administrator', 'I knew him since 2001. He have been always hard working and sincere and having a zeal for the God\'s work. However he was having his family responsibilities hence he could not come in the ministry. Now as God lead him, he gave his life to the ministry and started from zero in his village where he is living now. He has bearing good Christian values and character both in word and work. He has the potential of the planting Church and save souls and he has already did it without any support. He has been gone through one year Church planting training and still learning. 500k sponsorship will surely will help him to keep focus on ministry and of course he is good fit for the organization.    ', 290),
(235, 'Bhaskar Swain Administrator', 'Rajeev Kumar Nirala is good and sincere person. He has been very sincere in the ministry and have passion and zeal for the ministry. He is young and very enthusiastic for ministry. He has been faithful and having learning spirit. As I have seen him, he is very good in his moral and Christian characteristics. He is doing ministry independently without any support from anyone and planted a Church. He has good knowledge of the word and still submitted to learn from the word of God. He will be good fit for 500K as he has the burden for the dying souls and dedicated for the ministry. If he gets some financial backup he can do much more than what he is doing. ', 291),
(236, 'Bhaskar Swain Administrator', 'As an administrator, I have a good relationship with him. He has been sincere and hardworking guy and also dedicated to the ministry. He has been found to bearing good Christian values and moral ethics during his stay in the center. He is has burden for dying souls and zeal for gospel to spread. He has good potential of planting Church. He is also good in learning from the word of God and still have the heart for learning. He has been equipped with the theological knowledge during the training. He is good and faithful guy and faithful people are good for any organization. He will be good fit for 500k also.   ', 292),
(238, 'Awadhesh K Thakur', '1.  I have taught him in Sunday School, Youth Group and mentored during ICT course after returning from the RTI Bible Collage from Kerala. So he is known to me for long time.\r\n2. Bro Amit bears good character and testimony .\r\n3. He has good gospel sharing and preaching gift.\r\n4. He has Theological Competency because to fed his family working hard and using time to preach gospel whenever gets time and personal evangelism.\r\n5. Because he is sincere and honest about his calling it seems.', 297),
(240, 'Ratnaraj ', 'To be updated', 299),
(241, 'Awadhesh Kumar Thakur ', '1. I have taught him in Sunday School, Youth group and mentored during Team Gospel Outreach Programs since last 15 years.\r\n2. He is very laborious and practices good moral Character . \r\n3. He has preaching and Personal  counselling gifts from the Lord.\r\n4. He has  very strong theological competency  because he teaches youths and  believes very strongly  in the mother Church where is raised up.\r\n5. I believe he should be supported to concentrate on church  planting and discipling others to multiply more church partners as God has given this gift to him.\r\n\r\n', 300),
(242, 'Awadhesh Kumar Thakur ', '1) I have known him for last 7 years only as I met when visit his village for Gospel preaching .\r\n2) He bears good character .\r\n3) He has good personality  and respect in villages as he teaches music to children. His Bengali language  is also very nice and most importantly  he his very much praying  man.\r\n4) He doesn’t  have that much theological  knowledge  but since he is teachable , very soon in future he will be able to have stronger  convictions  than present.\r\n5) Since he is laborious , prayerful and passionate  for the lost souls , he is fit for 500k FW sponsorship  Program . ', 301),
(243, 'Awadhesh Kumar Thakur ', '1.  I know him for last 7 years.\r\n2. He bears good Character .\r\n3. He is passionate  about evangelism and lost souls.\r\n4. He has firm confirmation  about his calling and Theological stands.\r\n5. Because  he is passionate  for souls and doing  God`s work without waiting  for anyone  to support rather by doing  secular work. If Support  is provided , he will be able to invest his full time for the Lord.', 302),
(245, 'Awadhesh Kumar Thakur ', '1. I know him since year 2013.\r\n2. He bears good character and testimony .\r\n3. he is so passionate  to work among  Non- Christian  people  and uses music playing  as instruments  to assemble  the crowd  before preaching  Gospel regularly .\r\n4. He is strong  enough  to defend his faith and doctrine  he believes .\r\n5. He has got gift of souls winning .\r\n\r\n\r\n\r\n', 304),
(246, 'Awadhesh Kumar Thakur ', '1. I know him from the year 2017 as I taught him in BBTI.\r\n2. He  bears good testimony .\r\n3. He is from Santhal Tribe and he wants to serve among  them.\r\n4. He has theological  competency .\r\n5. He will be good resource  in santhali tribes to replicate more believers  from the same tribal  community  in that area.', 305),
(247, 'S. Abraham Samuel Jyothi', 'FW is personally known to me for the past five years. \r\nHe has studied in our Bible College. \r\nHe has established a good testimony.  \r\nHe has a special burden for Church planting.', 306),
(249, 'S. Abraham Samuel Jyothi', '1. Well known since 3 years met in gospel ministry.\r\n2. Hardworker, Ministry minded,  Faithful in spreading Gospel.\r\n3. He is committed to do full time ministry even in the bad times he has that dedication in preaching.\r\n4. Well versed with Theology the way he preached and delivered the messages.\r\n5. He worked along with our supervisor when ever they were given any ministry work they used to share the pulpit as well as the street preaching\'s.\r\n', 309),
(250, 'S. Abraham Samuel Jyothi', '20 Years Bonding involved in many ministry works together\r\nFW is theologically trained at our Bethel Bible Institute. \r\nDuring the two years of his study and stay, \r\nhe has exhibited a good testimony.  \r\nHe has genuine concern for Church planting ministry', 310),
(251, 'Sunil Subhakar', '1. Well known since 1 year met in gospel ministry.\r\n2. Hardworker, Ministry minded,  Faithful in spreading Gospel.\r\n3. He is committed to do full time ministry even in the bad times he has that dedication in preaching.\r\n4. Well versed with Theology the way he preached and delivered the messages.\r\n5. He worked along with our supervisor when ever they were given any ministry work they used to share the pulpit as well as the street preaching\'s.\r\n', 311),
(252, 'Sunil Subhakar', 'Well known since 6 years met in gospel ministry.\r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group.\r\n', 312),
(253, 'S. Abraham Samuel Jyothi', 'Well known since 2 years met in gospel ministry. \r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group\r\n', 313),
(254, 'S. Abraham Samuel Jyothi', '1. Well known since 4 years met in gospel ministry.\r\n2. Hardworker, Ministry minded,  Faithful in spreading Gospel.\r\n3. He is committed to do full time ministry even in the bad times he has that dedication in preaching.\r\n4. Well versed with Theology the way he preached and delivered the messages.\r\n5. He worked along with our supervisor when ever they were given any ministry work they used to share the pulpit as well as the street preaching\'s.\r\n', 314),
(255, 'S. Abraham Samuel Jyothi', '1.I know him personally since 3 years\r\n2. I believe him in his ministry work\r\n3. He has good testimony\r\n4. He done his theologically trained at bible course C.Th \r\n5. He is faithful to serve\r\n', 315),
(256, 'S. Abraham Samuel Jyothi', 'Known Personally since 3 years\r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group.\r\n \r\n', 317),
(258, 'S. Abraham Samuel Jyothi', '1.I know him personally since 5 years\r\n2. I believe him in his ministry work\r\n3. He has good testimony\r\n4. He done his theologically training. \r\n5. He is faithful to serve\r\n\r\n', 320),
(259, 'S. Abraham Samuel Jyothi', '1.I know him personally since 5 years\r\n2. I believe him in his ministry work\r\n3. He has good testimony\r\n4. He done his theologically training \r\n5. He is faithful to serve\r\n', 322),
(260, 'S. Abraham Samuel Jyothi', 'I Know him since 6 years. \r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group.\r\n', 323),
(261, 'Awadhesh Kumar Thakur ', '1. I know him from the year 2006.\r\n2. He has good moral character  and bears good testimony .\r\n3. God has given gift of Preaching  and  Teaching  both along with passion  for lost souls.\r\n4. He has very strong theological  competency  and apologetical  approach .\r\n5. He is laborious and passionate  for the souls  which matches with 500k vision  and statement .', 324),
(262, 'Awadhesh Kumar Thakur ', '1. As teacher I know him since year 2013.\r\n2. He bears good testimony  and moral character .\r\n3. He has calling for Church planting and gift of personal counselling  too.\r\n4. He has idea about Christian  doctrines  and continuing  his theological  studies  through  distance or online learning .\r\n5. Chakdah is new place where we don’t  have a single Chritian and its very strategic location  to reach upto Bangladesh border. It will help to fulfil the vision  and mission  of 500k. ', 325),
(263, 'Awadhesh Kumar Thakur ', '1. I know for last 3 years as Trainee in Community Intervention  Program  Participants  in the year 2018.\r\n2. He bears good character .\r\n3. He has preaching  and personal  counselling  gift with calling for evangelism.\r\n4. He is strong  enough  in doctrines  issues .\r\n5. As Church Planters it will be fitting  to 500k vision  and his calling  too.', 326),
(264, 'Awadhesh Kumar Thakur ', '1. I know him since the year 2015 as a teacher .\r\n2. He bears good character  and testimony .\r\n3. He has passion  for church Planting  and singing  gift too.\r\n4. He is strong  in theological  belief .\r\n5. He is working  for the Lord by doing  secular  work and if 500k Supports , he will a blessing for many.', 327),
(265, 'Gurram. Sekhar Founder &Director Jesus Loves Ministries', 'Known Personally since 5 years\r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group.\r\n', 328),
(266, 'S. Abraham Samuel Jyothi', 'I know him since 3 years . \r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group.\r\n', 329),
(267, 'Awadhesh Kumar Thakur ', '1. I know him from year 2011 as teacher\r\n2. He bears good testimony  and character .\r\n3. He is very good Gospel Preacher and counsellor .\r\n4. He is strong in theological  competence and learning  online to complete  M.Div.\r\n5. God has given him burden for church Planting  and it will fulfil  the vision and mission  of 500 K', 330),
(268, 'Awadhesh Kumar Thakur ', '1. I know him from the year 2015\r\n2. He bears good character .\r\n3. He has got gift of Soul wining by God.\r\n4. He is strong  enough .\r\n5. He will be great resources  of Church  Planting  not only  his place but to help other  too.', 331),
(269, 'Awadhesh Kumar Thakur ', '1. I know him from year 2018 as CIP Teacher.\r\n2. He bears good Character .\r\n3. He has passion  for the souls and work hard for the gospel.\r\n4. Yes. He has because he has been fund having  constructive debate with Cults group.\r\n5.  By planting Church  he will fulfil the vision of 500 K', 332),
(270, 'Awadhesh Kumar Thakur ', '1. I know since the year 2017.\r\n2. He bears good Character \r\n3. He has got gift of preaching  and Evangelism \r\n4. He is theologically strong as seen many times.\r\n5. Since he is passionate  for souls and evangelism , it will be matching  the vision of 500k.', 334),
(271, 'Awadhesh Kumar Thakur', '1. He came to the Lord in the year 2008 and baptised same year. Then he continued  his secular  studies and actively participated  in all local Church activities \r\n2. In the year 2015 he got call to serve the Lord during a Missionary  Conference  meeting  organised by a Group  of Churches  in Adra. Then to know more God`s word , he went to Bible School  for two years.\r\n3. He is very sincere  and have gift of preaching  and encouragement .\r\n4. He has been observed very strong  in theological  convictions  during  counselling  many.\r\n5. He has passion  to start churches and he is striving  for the same.', 335),
(272, 'Awadhesh Kumar Thakur', '1. I know him since the year 2017 as being a teacher to him.\r\n2. He bears good character  and Christian  testimony  in his locality .\r\n3. He is very sincere  and have gift of preaching  and encouragement .\r\n4. He has been observed very strong  in theological  convictions  during  counselling  many.\r\n5. He has passion  to start churches and he is striving  for the same.', 335),
(273, 'Awadhesh Kumar Thakur', '1. I came to know him in 2018 as he was praying  for a new field.\r\n2. He bears good character .\r\n3. He has call and passion  for the souls so he moved already to a new place.\r\n4. Ye he has strong theological  competency and convincing  gift too.\r\n5. he has passion for church Planting .', 336),
(274, 'Rev. Dr. Gurram. sekhar', '1. Active Student in our Institute we have spent 2 years \r\n2. Very Satisfactory \r\n3. We announced about the vision of our ministry He came up with this ideology, which made me to think and offer him this work.\r\n4. After His biblical training session he gave a testimony saying many things were learnt by him and God has enlightened him with good biblical knowledge.\r\n5. His ideology and dedication towards the given work and willingness to work among the poor people.\r\n\r\n\r\n\r\n', 337),
(275, 'Saleem Masih', 'I know her from past 2 years and she is good in ministry . She has a heart to serve in God\'s Kingdom. She is also good in Theology and love to serve people. ', 339),
(276, 'Saleem Masih', 'He is really good in ministry. He is also a great person loves to do the work of God. he is an good example of a godly man. ', 340),
(277, 'Saleem Masih', 'I have known him from a long time. He is a good man and also good in ministry. He is so good in his faith in God. He has a call for church planting in which he spend most of his time. He will be so effective in his ministry if he will be able to fulfill his church\'s needs. He is a sweet person and have good communication skills. He is going to be a great pastor with a great congregation.', 341),
(278, 'Saleem Masih', 'He is Spiritual man and really love God. Always ready to do God\'s work. he has so much potential in him. He works really hard to fulfill God\'s work from his life. ', 342),
(279, 'Saleem Masih', 'He is Spiritual man and really love God. Always ready to do God\'s work. he has so much potential in him. He works really hard to fulfill God\'s work from his life. ', 342),
(282, 'Saleem Masih', 'He is a great man and also had a great testimony how God saved and chose him. He is doing very well in his ministry. Even after facing a lot of persecution he still is doing the work of God in that same place. He is a courageous man and is faithful towards  God.', 345),
(284, 'Saleem Masih', 'He is a hardworking man and loves to do the work of God. He has committed his life to God. He always chose the God given ways. He has fear of God in his life. He lives a spiritually mature life and guides his family and congregation also to live in a manner as Jesus Christ.', 347),
(285, 'Saleem Masih', 'He is a hardworking man and loves to do the work of God. He has committed his life to God. He always chose the God given ways. He has fear of God in his life. He lives a spiritually mature life and guides his family and congregation also to live in a manner as Jesus Christ.', 347),
(286, 'Saleem Masih', 'He is a good person with integrity. He has this vision of saving lost people and really works hard on this vision. He is also a hardworking person and spiritually mature man of God.', 348),
(287, 'Yesudas', 'I know him for the past 10 years.  \r\n\r\nHe came to faith from a Hindu Background.  He came to saving knowledge at a very young age.  Took a stand for the Lord through the testing times in society.  He is passionate about the Gospel work.  He is good at teaching the Word.  He worked under Pastor Krishna Daniel and Pastor Munigilla John, who mentored him.  He has a strong evangelical background.\r\n\r\nHe has done his PG and Teacher Training.  He was teaching Hindi language in a High School.  After he lost his job during COVID, he started working in as Agricultural Labor while serving the Lord.\r\n\r\nHe gives tuition to school children up to the 5th standard.  This has given him an opportunity to teach songs to the children.  This has opened up doors to introduce Christ to young hearts.  Both husband and wife are good believers.\r\n\r\n.Support from 500K will help him meet the living expenses of his family while focusing on the ministry\r\n', 349),
(289, 'David Thevanithi', 'I know him well for last five years. He is a faithful and committed person and has thirst for doing the Lord`s ministry.', 351),
(290, 'David Thevanithi', 'I know him last 5 years, he is so faithful and committed to serve and burden on ministry for losting souls', 352),
(291, 'David Thevanithi', 'I know him well for last 5 years and he and his wife are so faithful and dedicated couple in the ministry. They have thirst towards lost souls.', 353),
(293, 'Praveen M', 'I know Bro. James for the last 3 years.  I was amazed at his interest to work for the Lord.  He has a deep passion to work for the Lord.  Although he is working as a stone cutter and as agricultural labor for his livelihood, he is striving to take the gospel to the unreached in his spare time.  \r\n\r\nHe is a good preacher.  His wife is also a believer and cooperates with him in the ministry.  Both of them are committed to Christ and His work.  Along with preaching he also sings well, which is an added advantage for his ministry.\r\n\r\nHe has done his Diploma in Pastoral Ministry from the International College of Cultural Studies.  He has a strong evangelical background.\r\n\r\nSeeing his labor and the hardships he is facing in meeting his family’s needs while taking up the Lord’s ministry, I thought he will be a good fit to get support from 500K.  It will help him to spare more time for the ministry and also start a ministry in the surrounding villages.\r\n', 355),
(294, 'Gurram. Sekhar Founder &Director Jesus Loves Ministries', 'Known Personally since 2 years\r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group.\r\n', 356),
(295, 'Gurram. Sekhar Founder &Director Jesus Loves Ministries', 'I Know him personally since 2 years\r\nHe has potential to plant church in spite hardships. \r\nHe has zeal to serve the Lord and has good testimony.\r\nHe is doctrinally sound has strong theological background. \r\nHe is Faithful to serve his target group.\r\n', 357),
(296, 'Sunil Subhakar', '1.I know him personally since 3 years\r\n2. I believe him in his ministry work\r\n3. He has good testimony\r\n4. He done his theologically training. \r\n5. He is faithful to serve\r\n\r\n', 358),
(297, 'Dhanraj Kota', 'I met him in Chandrapur to minister the Word, I used regularly visit his hometown.  He accepted the Lord at a very young age.  \r\n\r\nI had the opportunity to mentor him.  He has great concern for the perishing souls and is passionate to share the Gospel.  He has a vision for church planting.\r\n\r\nHe also worked for Pastor Prabhaker and has a good theological background.  Pastor Prabhaker has encouraged him to join the Bible College.\r\n\r\nSupport from 500K will help to meet family expenses and he can start a ministry in a new location.\r\n', 360),
(298, 'David Thevanithi', 'I know him well for last 5 years and He and his wife are faithful and dedicated couple in the ministry. They have thirst towards lost souls.', 361),
(299, 'Timothy Jebakumar', 'I know her family for last ten years. She has finished her biblical studies through Serve India Training Centre recently.  ', 362),
(300, 'Vijayakumar. D.', 'As I friend I know him well for last 6 years and he is a dedicated man of God  and has a thirst to share the gospel among the unsaved people and unreached areas. He is capable of doing the Lord`s ministry in a maximum way.', 364),
(301, 'Rev. Santosh S. Ghumalwar ', 'This is to certify that Mr. Manoj Kannake renews the Baptismal Covenant confessions of Jesus Christ as the Lord and Saviour. \r\n\r\nHe practices the Christina faith according to the Holy Bible.  \r\n\r\nHe has promised to live a Christian life and to be loyal the Church.\r\n\r\nHe has received full membership of the church after his baptism.\r\n\r\nHe has completed Basic Bible Training through BCM Ministries.  \r\n\r\nHe has demonstrated changed life and is passionate to win souls for Christ. \r\n', 365),
(302, 'Rev Vijay Tulshiram Kannake ', 'This is to certify that Mr. Mahendra Roshanlal Dongre has come into faith and Baptismal Covenant and confessed Jesus Christ as his personal Lord and savior and professed the Christian faith according to the Holy Scriptures.  \r\n\r\nHe has promised to live Christian Life and to be loyal and faithful to the church.\r\n\r\nI certify that he is a committed Christian, following the regulation of Church and is faithful to serve the Lord.\r\n\r\nHe has completed his Diploma in Theological Studies from Immanuel Prarthna Ghar Bible Seminary affiliated to Worldwide Evangelical Seminary, Cananda.  \r\n\r\nThe training has equipped him theologically to serve as an effective instrument for God.\r\n', 366),
(303, 'Rev Poulus Pipare ', 'I recommend Gopal Punaji Shedmake to work with NJM and 500K.  \r\n\r\nHe has accepted the Lord Jesus Christ in 2017 as his saviour and took Baptism in March of 2019.\r\n\r\nHe has been attending the fellowshipat BCM Church at Ghot, Chamorship Tq, Gadchiroli.  He has realized his call for the ministry.\r\n\r\nHe has completed his Bible Training at Gnot Bible Collage in 2020.  We at our Church have prayerfully anointed and dedicated for the ministry to serve in Khedi village.  \r\n\r\nI have no objection whatsoever to serve the Lord in His ministry along with NJM and 500K.\r\n', 367),
(305, 'Rev Vijay Tulshiram Kannake ', 'This is to certify that Mr. Gajanan Munghate has come into faith and Baptismal Covenant and confessed Jesus Christ as his personal Lord and savior and professed the Christian faith according to the Holy Scriptures.  \r\n\r\nHe has promised to live Christian Life and to be loyal and faithful to the church.\r\n\r\nI certify that he is a committed Christian, following the regulation of Church and is faithful to serve the Lord.\r\n\r\nHe has completed his Diploma in Theological Studies from Apollos Bible University.  This training has equipped him theologically to serve as an effective instrument for God.\r\n', 369),
(306, 'Rev Vijay Tulshiram Kannake ', 'This is to certify that Mr. Anil Shankar Onpakalwar has come into faith and Baptismal Covenant and confessed Jesus Christ as his personal Lord and savior and professed the Christian faith according to the Holy Scriptures.  \r\n\r\nHe has promised to live Christian Life and to be loyal and faithful to the church.\r\n\r\nI certify that he is a committed Christian, following the regulation of Church and is faithful to serve the Lord.\r\n\r\nHe has completed Basic Bible Studies course from Bible Centered Ministries.  This training has equipped him theologically to serve as an effective instrument for God.\r\n', 370),
(307, 'Zachariah', 'I know him well for last 6 years. he is a simple and committed brother. he is so interested in the ministry. ', 371);
